{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/pacifiquenteta/bellabeat-capstone-case-study?scriptVersionId=115128187\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"f67422f1","metadata":{"papermill":{"duration":0.011359,"end_time":"2022-12-31T00:47:30.36764","exception":false,"start_time":"2022-12-31T00:47:30.356281","status":"completed"},"tags":[]},"source":["# 1. Introduction\n","\n","## 1.1. Scenario\n","\n","In this scenario , i am a junior data analyst working at Bellabeat, a high tech manufacturer of health-focused products.\n","\n","## 1.2. Company Backgroung\n","\n","\n","[Bellabeat](https://bellabeat.com/) is a high-tech company that manufacturers health-focused smart products. The company offers the following products/services :\n","\n","-   **Bellabeat app**: The Bellabeat app provides users with health data related to their activity, sleep, stress, menstrual cycle, and mindfulness habits. This data can help users better understand their current habits and make healthy decisions. The Bellabeat app connects to their line of smart wellness products.\n","\n","-   **Leaf**: Bellabeat's classic wellness tracker can be worn as a bracelet, necklace, or clip. The Leaf tracker connects to the Bellabeat app to track activity, sleep, and stress.\n","\n","-   **Time**: This wellness watch combines the timeless look of a classic timepiece with smart technology to track user activity, sleep, and stress. The Time watch connects to the Bellabeat app to provide you with insights into your daily wellness.\n","\n","-   **Spring**: This is a water bottle that tracks daily water intake using smart technology to ensure that you are appropriately hydrated throughout the day. The Spring bottle connects to the Bellabeat app to track your hydration levels.\n","\n","-   **Bellabeat membership**: Bellabeat also offers a subscription-based membership program for users. Membership gives users 24/7 access to fully personalized guidance on nutrition, activity, sleep, health and beauty, and mindfulness based on their lifestyle and goals.\n","\n","## 1.3. Project Overview\n","\n","The company, since its establishment in 2013, is successful and has grown rapidly. But it also have the potential to become a larger player in the global smart device market. For this reason, Urška Sršen, co-founder and chief creative officer has asked the marketing analyst team to analyse data of non-Bellabeat smart device consumers to gain insights that could help the marketing team develop a marketing strategy to help the company fulfill its potential of becoming a larger player in the global smart device market. The results of the analysis will be presented to the executive team along with recommendations for marketing strategies.\n","\n","# 2. Ask\n","\n","The following questions were used : \n","- What is the problem i am trying to solve?\n","- Who are the stakeholders? \n","- What are the stakeholders expecting?\n","- What are the trends in smart device usage? \n","- How could these trends help Bellabeat marketing team?\n","\n","## 2.1. Business Task\n","\n","The business tasks are : \n","- Analyse data of non Bellabeat smart devices users to gain insights on how they are using their devices. \n","- Recommend Bellabeat marketing strategies that will unlock growth opportunities for the company.\n","\n","## 2.2. Stakeholders\n","\n","The key stake holders are : \n","\n","- Urška Sršen: Bellabeat's co-founder and Chief Creative Officer.\n","\n","-   Sando Mur: Mathematician and Bellabeat's co-founder; key member of the Bellabeat executive team.\n","\n","-   The rest of the executive team to whom the recommendations will be presented.\n","\n","# 3. Prepare\n","\n","The data that will be used for the analysis is FitBit Fitness Tracker Data which is a CCO Public Domain licenced dataset made available through Mobius. This Kaggle data set contains personal fitness tracker from thirty fitbit users. Thirty eligible Fitbit users consented to the submission of personal tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring. It includes information about daily activity, steps, and heart rate that can be used to explore users' habits. This dataset generated by respondents to a distributed survey via Amazon Mechanical Turk between 03.12.2016-05.12.2016. The data collected was then originally published on [Zenodo](https://zenodo.org/record/53894#.YMoUpnVKiP9).\n","\n","The data is **limited** and **outdated** because it was tracked between the 12th of April 2016 and the 12th of May 2016, and it does not specify details such as gender, age, salary,... as these information might be very important in this analysis.\n","\n","## 3.1. Data Exploration with Excel and BigQuerry\n","\n","after dowloading the data, i saved it in a safe and secure folder and named it in a way that will allow me to easily access it. Then to familiarize with the data, i explored the data with Microsoft Excel and Google BigQuerry.\n","\n","### 3.1.1. Observations made while exploring data\n","\n","While trying to load explore data with Excel and BigQuerry, i noticed the following things :\n","\n","-   I notice that the data in `dailyCalories_merged.csv`, `dailyIntensities_merged.csv` and `dailySteps_merged.csv` have already been incorporated/merged in `dailyActivity_merged.csv`.\n","\n","-   I was unable to load properly `heartrate_seconds_merged.csv` file in Excel as it had number of rows that exceeded Excel capacity.\n","\n","-   I was only able to upload the `dailyActivity_merged.csv`, `dailySteps_merged.csv`, `dailyCalories_merged.csv`, `dailyIntensities_merged.csv` tables/data frames in BigQuerry as the other tables/data frames had data format were not compatible with BigQuerries.\n","\n","-   I aslo noticed that there is a possibility to join the `hourlyCalories_merged.csv` , `hourlySteps_merged.csv` and the `hourlyIntensities_merged.csv` data frames in one data frame.\n","\n","## 3.2. Loading data in R\n","\n","After getting familiar with the Data(with Excel and BigQuerry), i then preceded to explore it further with R.\n","\n","### 3.2.2. Loading the needed packages\n"]},{"cell_type":"code","execution_count":1,"id":"d29fe6b7","metadata":{"execution":{"iopub.execute_input":"2022-12-31T00:47:30.394147Z","iopub.status.busy":"2022-12-31T00:47:30.391498Z","iopub.status.idle":"2022-12-31T00:47:32.601833Z","shell.execute_reply":"2022-12-31T00:47:32.599749Z"},"papermill":{"duration":2.226106,"end_time":"2022-12-31T00:47:32.604838","exception":false,"start_time":"2022-12-31T00:47:30.378732","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.2 ──\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.6      \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.5 \n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.8      \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.10\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.2.1      \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.1 \n","\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.1.3      \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.2 \n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","\n","Attaching package: ‘janitor’\n","\n","\n","The following objects are masked from ‘package:stats’:\n","\n","    chisq.test, fisher.test\n","\n","\n","here() starts at /kaggle/working\n","\n","\n","Attaching package: ‘lubridate’\n","\n","\n","The following objects are masked from ‘package:base’:\n","\n","    date, intersect, setdiff, union\n","\n","\n","Loading required package: gsubfn\n","\n","Loading required package: proto\n","\n","Warning message:\n","“no DISPLAY variable so Tk is not available”\n","Loading required package: RSQLite\n","\n"]}],"source":["\n","library(tidyverse) #For data manipulation, exploration and visualization.\n","#Tidyverse contains many packages but for this project, the following packages were needed : \n","#- ggplot2: For data visualization.\n","#- dplyr: For effective data manipulation.\n","#- readr: For importing data.it makes it possible to read data out of comma separated (csv), tab separated (tsv) or fixed width files (fwf).\n","#- tidyr: For data cleaning.\n","library(skimr) #To provide summary statistics about variables in data frames, tibbles, data tables and vectors.\n","library(janitor)#For data examination and cleaning.\n","library(here)#To enable easy file referencing. \n","library(lubridate)#To work with date-times.\n","library(sqldf) #To manipulate data with SQL commands. While working on this project, there was a command/problem that i wasn't able to solve in R but i was able to do that in SQL then i found out it was possible to execute SQL queries/commands in R. But i eventually was able to solve the problem with R."]},{"cell_type":"markdown","id":"bc0c87ca","metadata":{"papermill":{"duration":0.01158,"end_time":"2022-12-31T00:47:32.627353","exception":false,"start_time":"2022-12-31T00:47:32.615773","status":"completed"},"tags":[]},"source":["### 3.2.3 Data loading."]},{"cell_type":"code","execution_count":2,"id":"c4401d47","metadata":{"execution":{"iopub.execute_input":"2022-12-31T00:47:32.697832Z","iopub.status.busy":"2022-12-31T00:47:32.652067Z","iopub.status.idle":"2022-12-31T00:47:33.808298Z","shell.execute_reply":"2022-12-31T00:47:33.805377Z"},"papermill":{"duration":1.173889,"end_time":"20