cising/being active thus they are not hitting the recommended number of steps per day. They are barely just getting enough sleep.\n","To confirm these early assumptions, let's get some visualizations.\n","\n","## 5.3. Visualizations\n","\n","### 1. Sedentary Minutes vs Minutes Asleep.\n"]},{"cell_type":"code","execution_count":23,"id":"f8c452b9","metadata":{"_kg_hide-input":true,"_kg_hide-output":true,"execution":{"iopub.execute_input":"2022-12-31T00:47:39.107771Z","iopub.status.busy":"2022-12-31T00:47:39.105466Z","iopub.status.idle":"2022-12-31T00:47:41.414492Z","shell.execute_reply":"2022-12-31T00:47:41.411814Z"},"papermill":{"duration":2.337512,"end_time":"2022-12-31T00:47:41.419429","exception":false,"start_time":"2022-12-31T00:47:39.081917","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["`geom_smooth()` using method = 'loess' and formula 'y ~ x'\n","\n"]},{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ3wU1f4G8N9s7+kJEGogCFJCDYSOIEWqFL1YuKKgwAX/KAp4sYAoIgiIIiiC\nghVQFJSiCFdEWkLvhN4CJJCym+1lzv/FyBJC2Gwg2dlsnu8LPrs7kzm/mWU3T86ZM8MxxggA\nAAAAyj+J2AUAAAAAQOlAsAMAAAAIEQh2AAAAACECwQ4AAAAgRCDYAQAAAIQIBDsAAACAEIFg\nBwAAABAiEOwAAAAAQkSoBTuP/eKS915+uE3jmAiDXKYwRFVp3qnvGx+vNHpK7TrMc2tHcBy3\nPtdeWhsMKjnpT3Icx3Fc5APT77oSb6+nVQir/Wl0CK/tfa0Jx3E9/7oSoELLgO3GKo7jJFLF\nXrPrbut0jVBzHDfkXnezIh/eQhhvqatRCAd8z90PuA+H3m/JcVyXNedLuzQAgHIspIKd+eK6\n1tXrDf/v3M2p6fLwKs1bNKkaxu/fuvadFx+vUb/fbpNT7AKLwXjL9u3bU/dcErsQIqK8028f\ntbqLXJR7emq69V5+E9+bgB0WdfTAEZV1jHdNWHOhyBUs1z7fnGeXyqPmpFS6z7Yq4OEtJPvw\npFM2FxEx3jXhp/MBbh0AIFSFULBjzmdT/rXnuq3eoDcOX8m7cu7Erl1px85eu3Fi6wvtKxtP\n/dqz/etil1gMt+1ku3btug38XOxCiJPIGO94dePlIpfue/MHIpJLuIIv1hw8benSpePrRZR6\nMYE8LONea0RE+978usil6Z8sIKKY5h9UVtzXB6fCHt6CtryymoiqPJJARPve+jLArQMAhKrQ\nCXbG82//cMWsiui6Z8XUBnFq7+uRddst2LQ3SafIPjRr1uV8ESssR8JqTZRyXNrkn4pYxtyT\n1l9SGlK6hCsLvhzVrM+///3vrgWOfHlUe+h7Uo4znnuvyMHBeZ+fIqIuM7vfZysV9vB68e6c\ncX9f5TjJokU/qiWc6cLMbUHf