were more interested in the number of steps made per day, the calories burnt, and the distances covered per day than the number of sleep hours or the weight.\n","- The users started being active(making steps) from 5:00 am but had two major peaks during the day; from 11 am to 2 pm and from 4 pm to 8pm.\n","\n","Based on these findings, i recommend Bellabeat the following :\n","\n","## 2. Recommendations\n","\n","- The app should encourage daily steps and sleep hours target to help users hit 10000 steps a day and have sleep time of at least 7 hours(or more or less based on the user's age and profile).  \n","\n","- The app should also have notifications to remind users whether or not they have hit their daily target or just remind them when they are close to hitting their daily target. \n","\n","- To help users be more active during the day and help them reduce sedentary time, upon subscription, user's should receive personalized program based on their profile including personal work out routine.\n","\n","- The app should have notifications and reminders to help users record and track all their activities and on a daily basis.\n","\n","\n","\n","\n","#### **Thank you for your interest in my Bellabeat Case Study.**\n","\n","*This is my first project using R. While going through the instructions again, i realized that i omitted one instruction which suggested to find some other similar data set since this one was outdated and limited; so i decided to complete the project as it is and then come back later to do a revised version having the omitted instruction in mind. But i will still appreciate comments and suggestions for improvement. "]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":17.483932,"end_time":"2022-12-31T00:47:43.915585","environment_variables":